import React, { useState } from "react";

import Filters from "./Filters";

export default function Header({
  Button,
  setRegistros,
  filtrarRegistros,
  setFiltrarRegistros,
}) {
  const [apagarRegistros, setApagarRegistros] = useState(false);
  function filtrar(t) {
    setFiltrarRegistros(t);
  }
  return <div></div>;
}
